import "./UserList.css"
import { DataGrid } from '@material-ui/data-grid';


export default function UserList(){
    const columns = [
        { field: 'id', headerName: 'ID', width: 90 },
        {
          field: 'Username',
          headerName: 'Username',
          width: 150,
          editable: true,
        },
        {
          field: 'email',
          headerName: 'Email',
          width: 150,
          editable: true,
        },
        {
          field: 'CodeForces Handle',
          headerName: 'CodeForces Id',
          type: 'string',
          width: 200,
          editable: true,
        },
        {
            field: 'CodeChef',
            headerName: 'CodeChef Id',
            type: 'string',
            width: 200,
            editable: true,
          },
        
      ];
      
      const rows = [
        { id: 1, Username: 'Snow', avtar:"https://images.pexels.com/photos/4172933/pexels-photo-4172933.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=650&w=940", email: "xyz@",current },
        { id: 2, lastName: 'Lannister', firstName: 'Cersei', age: 42 },
        { id: 3, lastName: 'Lannister', firstName: 'Jaime', age: 45 },
        { id: 4, lastName: 'Stark', firstName: 'Arya', age: 16 },
        { id: 5, lastName: 'Targaryen', firstName: 'Daenerys', age: null },
        { id: 6, lastName: 'Melisandre', firstName: null, age: 150 },
        { id: 7, lastName: 'Clifford', firstName: 'Ferrara', age: 44 },
        { id: 8, lastName: 'Frances', firstName: 'Rossini', age: 36 },
        { id: 9, lastName: 'Roxie', firstName: 'Harvey', age: 65 },
      ];


    return(
        <div className="userList">
       <DataGrid
        rows={rows}
        columns={columns}
        pageSize={5}
        checkboxSelection
        disableSelectionOnClick
      />
        </div>
    )
}
